import React from 'react';
import { BrowserRouter , Routes , Route , Link } from "react-router-dom";

function Nav ({ texto }) {
	return (
		<nav>
		
			{/* <Routes>
				<Route path="/" element={<Home />} />
				<Route path="about" element={<About />} />
			</Routes>
		
			<Link to="/about">About</Link> */}
		
			<ul>
				<li>{texto} 1</li>
				<li>{texto} 2</li>
				<li>{texto} 3</li>
				<li>{texto} 4</li>
			</ul>
		</nav>
	);
}

export default Nav;
